import Isi from '../../komponen/isi';
import Layout from '../../layout/layouts';

class Data extends React.Component{
            render(){
                return(
                    <Layout>
                    <div class="data" >
                        <section >
                <div id="Bioskop" class="view"><h2>Bioskop</h2> </div>
            <div class="main_bioskop">
                <Isi link="/proyek/pembayaran" img="1.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Sonic" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="2.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Star Wars" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="3.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Mulan" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="4.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Jumanji" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                
                <Isi link="/proyek/pembayaran" img="5.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Dora" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="6.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Avengers" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="7.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="The Box" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="8.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="The Jack in the Box " starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
            
                <Isi link="/proyek/pembayaran" img="9.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Scary Movie" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="10.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Bloodshot" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="11.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Maleficent" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/proyek/pembayaran" img="12.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Rumble" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                
                </div></section>  
                    </div></Layout>
                )
            }
        }
     
        export default Data;
